  \"2016-04-28T01:26:35.808272\",\n\t\"name\": \"fort-bliss-geothermal-area-data-temperature-profile-logs-schematic-model-and-cross-section\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains a variety of data
  about the Fort Bliss geothermal area, part of the southern portion of the Tularosa
  Basin, New Mexico.  The dataset contains schematic models for the McGregor Geothermal
  System, a shallow temperature survey of the Fort Bliss geothermal area.  The dataset
  also contains Century OH logs, a full temperature profile, and complete logs from
  well RMI 56-5, including resistivity and porosity data, drill logs with drill rate,
  depth, lithology, mineralogy, fractures, temperature, pit total, gases, and descriptions
  among other measurements as well as CDL, CNL, DIL, GR Caliper and Temperature files.
  \ nnA shallow (2 meter depth) temperature survey of the Fort Bliss geothermal area
  with 63 data points is also included.nnTwo cross sections through the Fort Bliss
  area, also included, show well position and depth. The surface map included shows
  faults and well spatial distribution.  Inferred and observed fault distributions
  from gravity surveys around the Fort Bliss geothermal area.\",\n\t\"license_title\":
